import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  Container, Paper, Typography, Table, TableBody,
  TableCell, TableContainer, TableHead, TableRow
} from '@mui/material';

const PredictionHistory = () => {
  const [history, setHistory] = useState([]);
  const [clicked, setClicked] = useState(false); // Added state for navbar toggle

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const response = await axios.get('http://localhost:5000/history');
        setHistory(response.data);
      } catch (error) {
        console.error('Error fetching prediction history:', error);
      }
    };

    fetchHistory();
  }, []);

  const handleClick = () => {
    setClicked(!clicked); // Toggle the navbar
  };

  return (
    <>
      <nav>
        <a href="#">
          <svg 
            id="logo-15" 
            width="49" 
            height="48" 
            viewBox="0 0 49 48" 
            fill="none" 
            xmlns="http://www.w3.org/2000/svg"
          >
            {/* SVG paths here */}
          </svg>
        </a>
        <div>
          <ul id="navbar" className={clicked ? "active" : ""}>
            <li><a className="active" href="/adusemin">Back</a></li>
            <li><a href="/home">Logout</a></li>
          </ul>
        </div>
        <div id="mobile" onClick={handleClick}>
          <i id="bar" className={clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
        </div>
      </nav>
      <Container maxWidth="lg">
        <Paper elevation={3} style={{ padding: '20px', marginTop: '20px' }}>
          <Typography variant="h4" align="center" gutterBottom style={{ fontWeight: 'bold' }}>
            Prediction History
          </Typography>
          <TableContainer>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell align="center">Pregnancies</TableCell>
                  <TableCell align="center">Glucose</TableCell>
                  <TableCell align="center">Blood Pressure</TableCell>
                  <TableCell align="center">Skin Thickness</TableCell>
                  <TableCell align="center">Insulin</TableCell>
                  <TableCell align="center">BMI</TableCell>
                  <TableCell align="center">Diabetes Pedigree Function</TableCell>
                  <TableCell align="center">Age</TableCell>
                  <TableCell align="center">Result</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {history.map((entry, index) => (
                  <TableRow key={index}>
                    {entry.features.map((feature, idx) => (
                      <TableCell key={idx} align="center">{feature}</TableCell>
                    ))}
                    <TableCell align="center">
                      {entry.result === 0 ? 'Not Diabetic' : 'Diabetic'}
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Paper>
      </Container>
    </>
  );
};

export default PredictionHistory;
